import "./index.css";

import { Todo } from "../../types";

interface FooterProps {
  calculateTotal: () => void;
  calculateFinished: () => void;
}

export default function Footer({
  calculateFinished,
  calculateTotal,
}: FooterProps) {
  return (
    <div className="todo-footer">
      <label>
        <input type="checkbox" />
      </label>
      <span>
        {" "}
        <span>Finished 0</span> / total: {calculateFinished()}
      </span>
      <button className="btn btn-danger">Delete Finished Tasks</button>
    </div>
  );
}
